import React from 'react';
import { View, ScrollView } from 'react-native';
import { Header, Icon, ListItem, Avatar } from 'react-native-elements';

export default function NovoContato({ navigation }) {
    const goToLogin = () => {
        navigation.navigate('Login');
    };

    const list = [
        {
            name: 'Amy Farha',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
        {
            name: 'Chris Jackson',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
    ];

    return (
        <>
            <Header
                centerComponent={{
                    text: 'Novo Contato',
                    style: { color: '#fff', fontWeight: 'bold' },
                }}
                leftComponent={
                    <Icon name="arrow-left" color="#fff" onPress={goToLogin} />
                }
                containerStyle={{ backgroundColor: '#1670f7' }}
            />

            <ScrollView>
                {list.map((l, i) => (
                    <ListItem
                        key={i}
                        leftAvatar={{ source: { uri: l.avatar_url } }}
                        title={l.name}
                        bottomDivider
                    />
                ))}
            </ScrollView>
        </>
    );
}
